export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},GJBnKUV0yY:{data:{id:2487,attributes:{imdbId:"tt5742374",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMDkwOTE0ZjMtZmRiYS00M2M3LWE3MzUtNzNmNmExNTNmNjg5XkEyXkFqcGdeQXVyODE1MjMyNzI@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"89%"},{Source:"Metacritic",Value:"84\u002F100"}],item_lang:{data:{id:3150,attributes:{title:e,plot:"Balancing between feverish dreamlike hallucinations of a tormented past and a grim disoriented reality, the grizzled Joe--a traumatised Gulf War veteran and now an unflinching hired gun who lives with his frail elderly mother--has just finished yet another successful job. With an infernal reputation of being a brutal man of results, the specialised in recovering missing teens enforcer will embark on a blood-drenched rescue mission, when Nina, the innocent 13-year-old daughter of an ambitious New York senator, never returns home. But amidst half-baked leads and a desperate desire to shake off his shoulders the heavy burden of a personal hell, Joe's frenzied plummet into the depths of Tartarus is inevitable, and every step Joe takes to flee the pain, brings him closer to the horrors of insanity. In the end, what is real, and what is a dream? Can there be a new chapter in Joe's life when he keeps running around in circles?",slug:"you-were-never-really-here"}}},books:{data:[{id:12015,attributes:{title:e,description:h,thumbnail:i,authors:[a],firstBook:true,published:j,publisher:k,subtitle:c}},{id:12016,attributes:{title:e,description:h,thumbnail:i,authors:[a],firstBook:d,published:j,publisher:k,subtitle:c}},{id:12017,attributes:{title:"The Alcoholic (10th Anniversary Expanded Edition)",description:"In the proud tradition of drunken writers everywhere . . . comes the tale of Jonathan A., a boozed-up, coked-out, sexually confused, hopelessly romantic-and of course, entirely fictional-novelist who bears only a coincidental resemblance to real-life author Jonathan Ames, critically acclaimed author of Wake Up, Sir!, The Extra Man, and What's Not to Love as well as HBO's Bored to Death and Starz's Blunt Talk Featuring gritty, yet poignant artwork by Dean Haspiel (The Quitter), The Alcoholic marks Ames' hilarious yet heartbreaking graphic novel debut. This tenth anniversary edition hardcover also features a new afterword by Jonathan Ames as well as a special behind-the-scenes artist section!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1SBcDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2018-09-25",publisher:"Dark Horse Comics",subtitle:c}},{id:12018,attributes:{title:l,description:"‘Shot through with darkly comic flourishes. Motel, money, murder, madness: it has all you need to keep you happy’ THE TIMES, THRILLER OF THE MONTH Meet Happy Doll Hap to his friends. He's a LA private detective living a quiet life along with his beloved half-Chihuahua half-Terrier, George. He's getting by just fine When he's not walking George or sipping tequila, Hap works nights at the Thai Miracle Spa, protecting the women who work there from clients who won't take \"no\" for an answer. Until he kills a man Usually Doll avoids trouble by following his two basic rules: bark loudly and act first. But after a deadly fight with a customer, even he finds himself wildly out of his depth... A Man Named Doll is both a hilarious introduction to an unforgettable character, and a high-speed joyride through the sensuous and violent streets of LA.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_TwqEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2021-04-29",publisher:"Pushkin Press",subtitle:"‘I loved this book’ LEE CHILD"}},{id:12019,attributes:{title:l,description:"From the creator of HBO's Bored to Death, a deliciously noir novel about idiosyncratic private detective Happy Doll and his quest to help a dying friend in a sun-blinded Los Angeles as \"quirky, edgy, charming, funny and serious\" as its protagonist (Lee Child) Happy Doll is a charming, if occasionally inexpert, private detective living just one sheer cliff drop beneath the Hollywood sign with his beloved half-Chihuahua half-Terrier, George. A veteran of both the Navy and LAPD, Doll supplements his meager income as a P.I. by working through the night at a local Thai spa that offers its clients a number of special services. Armed with his sixteen-inch steel telescopic baton, biting dry humor, and just a bit of a hero complex, the ex-cop sets out to protect the women who work there from clients who have trouble understanding the word \"no.\" Doll gets by just fine following his two basic rules: bark loudly and act first. But when things get out-of-hand with one particularly violent patron, even he finds himself wildly out of his depth, and then things take an even more dangerous twist when an old friend from his days as a cop shows up at his door with a bullet in his gut. A Man Named Doll is more than just a fascinating introduction to one truly singular character, it is a highly addictive and completely unpredictable joyride through the sensuous and violent streets of LA.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=alj1DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2021-04-20",publisher:"Hachette UK",subtitle:c}}]}}},meta:{}}},prerenderedAt:1681309593989}}("Jonathan Ames","movie","",null,"You Were Never Really Here","series",1,"Now a major motion picture starring Joaquin Phoenix, You Were Never Really Here is a gritty, harrowing story of corruption and one man's violent quest for vengeance. Joe has witnessed things that cannot be erased. A former FBI agent and Marine, his abusive childhood has left him damaged beyond repair. He has completely withdrawn from the world and earns his living rescuing girls who have been kidnapped into the sex trade. When he's hired to save the daughter of a corrupt New York senator held captive at a Manhattan brothel, he stumbles into a dangerous web of conspiracy, and he pays the price. As Joe's small web of associates are picked off one by one, he realizes that he has no choice but to take the fight to the men who want him dead. Brutal and redemptive in equal measure, You Were Never Really Here is a toxic shot of a thriller, laced with corruption, revenge and the darkest of inner demons.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=idg7DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2018-03-20","Vintage","A Man Named Doll"))